from telebot.types import InlineKeyboardButton, InlineKeyboardMarkup


# 该文件定义了整个项目所需的全部按钮，问卷的文本内容以及可供用户查询的药品及其链接。
# Этот файл определяет все кнопки, тексты опросников и доступные для
# запроса средства, а также ссылки на них, необходимые для всего проекта.


def keyboard(a, b):  # 机器人全部按钮
    __keyboard = InlineKeyboardMarkup()
    # ——————————————————————————————————————————————————————————————————————————————————————————————————————————————————
    # 公共按钮
    if a == 1:  # 基础功能（是与非）
        button_01 = InlineKeyboardButton('Да', callback_data=b[0])
        button_02 = InlineKeyboardButton('Нет', callback_data=b[1])
        __keyboard.add(button_01, button_02)
    elif a == 2:  # 基础功能（是与非 + 返回）
        button_01 = InlineKeyboardButton('Да', callback_data=b[0])
        button_02 = InlineKeyboardButton('Нет', callback_data=b[1])
        button_03 = InlineKeyboardButton('Предыдущий', callback_data=b[2])
        __keyboard.add(button_01, button_02, button_03)
    elif a == 3:  # 基础功能（返回）
        button_01 = InlineKeyboardButton('Предыдущий', callback_data=b)
        __keyboard.add(button_01)

    # ——————————————————————————————————————————————————————————————————————————————————————————————————————————————————
    # start1 的按钮
    elif a == 4:  # 问卷选项
        buttons_name = ['Ни разу', 'Несколько дней', 'Более недели', 'Каждый день', 'Предыдущий']
        buttons = []
        for i in range(5):
            buttons.append(InlineKeyboardButton(text=f'{buttons_name[i]}', callback_data=f'{b[i]}'))
        for i in range(0, 4, 2):
            __keyboard.add(buttons[i], buttons[i + 1])
        __keyboard.add(buttons[4])
    elif a == 5:  # 药物使用说明
        button_01 = InlineKeyboardButton('Повышения', callback_data=b[0])
        button_02 = InlineKeyboardButton('Отмены', callback_data=b[1])
        button_03 = InlineKeyboardButton('Ср. доз', callback_data=b[2])
        __keyboard.add(button_01, button_02, button_03)

    # ——————————————————————————————————————————————————————————————————————————————————————————————————————————————————
    # start3 的按钮
    elif a == 6:  # 推荐药物查询
        buttons_name = ['Эсциталопрам', 'Флуоксетин', 'Флувоксамин', 'Пароксетин', 'Сертралин', 'Дулоксетин',
                        'Кломипрамин', 'Атомоксетин', 'Миртазапин', 'Тразодон', 'Вортиоксетин', 'Венлафаксин',
                        'Амитриптилин', 'Имипрамин']
        buttons = []
        for i in range(14):
            buttons.append(InlineKeyboardButton(text=f'{buttons_name[i]}', callback_data=f'{b[i]}'))
        for i in range(0, 14, 2):
            __keyboard.add(buttons[i], buttons[i + 1])
    elif a == 7:  # 推荐药物查询错误
        button_01 = InlineKeyboardButton('Да, повторить.', callback_data=b)
        __keyboard.add(button_01)

    # ——————————————————————————————————————————————————————————————————————————————————————————————————————————————————
    # start4 的按钮
    elif a == 8:  # 按 8 种类别划分的禁忌症
        buttons_name = ['1. Возраст', '2. Пищ-система', '3. МП-система', '4. Сердце-сосуды', '5. Бер. и лакт.',
                        '6. Нерв. система', '7. Эндокр. сист.', '8. Другие виды', 'Предыдущий']
        buttons = []
        for i in range(9):
            buttons.append(InlineKeyboardButton(text=f'{buttons_name[i]}', callback_data=f'{b[i]}'))
        for i in range(0, 8, 2):
            __keyboard.add(buttons[i], buttons[i + 1])
        __keyboard.add(buttons[8])
    elif a == 9:  # 按年龄划分的禁忌症
        buttons_name = ['До 6 лет', 'До 12 лет', 'До 15 лет', 'До 18 лет', 'Предыдущий']
        buttons = []
        for i in range(5):
            buttons.append(InlineKeyboardButton(text=f'{buttons_name[i]}', callback_data=f'{b[i]}'))
        for i in range(0, 4, 2):
            __keyboard.add(buttons[i], buttons[i + 1])
        __keyboard.add(buttons[4])
    elif a == 10:  # 按消化系统疾病划分的禁忌症
        button_01 = InlineKeyboardButton('1. Печ-недостат', callback_data=b[0])
        button_02 = InlineKeyboardButton('2. Цирр. печ.', callback_data=b[1])
        button_03 = InlineKeyboardButton('Предыдущий', callback_data=b[2])
        __keyboard.add(button_01, button_02, button_03)
    elif a == 11:  # 按泌尿生殖系统疾病划分的禁忌症
        buttons_name = ['1. ПНД', '2. ДГПЖ', '3. АМП', '4. ОМП', '5. Зад. мочи', '6. Приап. анамн.', 'Предыдущий']
        buttons = []
        for i in range(7):
            buttons.append(InlineKeyboardButton(text=f'{buttons_name[i]}', callback_data=f'{b[i]}'))
        for i in range(0, 6, 2):
            __keyboard.add(buttons[i], buttons[i + 1])
        __keyboard.add(buttons[6])
    elif a == 12:  # 按心血管疾病划分的禁忌症
        buttons_name = ['1. ОРВ ИМ', '2. Неконтр. АГ', '3. Ишем. сердца', '4. ХСН', '5. Нар. провод.', 'Предыдущий']
        buttons = []
        for i in range(6):
            buttons.append(InlineKeyboardButton(text=f'{buttons_name[i]}', callback_data=f'{b[i]}'))
        for i in range(0, 6, 2):
            __keyboard.add(buttons[i], buttons[i + 1])
    elif a == 13:  # 按疾神经系统病划分的禁忌症
        button_01 = InlineKeyboardButton('1. СС и эпилепсия', callback_data=b[0])
        button_02 = InlineKeyboardButton('2. После инсульта', callback_data=b[1])
        button_03 = InlineKeyboardButton('Предыдущий', callback_data=b[2])
        __keyboard.add(button_01, button_02, button_03)
    elif a == 14:  # 按其他类型疾病划分的禁忌症
        buttons_name = ['1. Мания', '2. Закр. глаук.', '3. Инф. забол.', '4. КФН', '5. ИНАП-препараты', 'Предыдущий']
        buttons = []
        for i in range(6):
            buttons.append(InlineKeyboardButton(text=f'{buttons_name[i]}', callback_data=f'{b[i]}'))
        for i in range(0, 6, 2):
            __keyboard.add(buttons[i], buttons[i + 1])

    return __keyboard


